import React from "react";
import { Navigate, useParams } from "react-router-dom";

import "./Item.css";

const Item = ({items}) => {
  let {itemId} = useParams();  

  if (!itemId) {
    return <Navigate to="/"/>;
  }

  const findItem = (id) => {
    return items.find((item) => item.id === id);
  };
  const item = findItem(itemId);
  console.log(item);
  return (    
    <div>
    </div>
  );
};

export default Item;
